import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.sass']
})
export class AppComponent {

  password = '';

  onButtonClick() {
    this.password = "My Password";
    console.log("Button Clicked");
  }
}
